pybossa.taskLoaded(function(task, deferred){
	deferred.resolve(task);

pybossa.presentTask(function(task, deferred){
	if (!$.isEmptyObject(task)) {
		$("#answerBoxCity").val("");
		$("#answerBoxState").val("");
		$("#answerBoxZipcode").val("");
		$("#question_holder").text(task.info['question']);
		$("#save").off('click').on('click', function(evt) {
			var answer = {}
			answer["city"] = $("#answerBoxCity").val().toUpperCase();;
			answer["state"] = $("#answerBoxState").val().toUpperCase();;
			answer["zipcode"] = $("#answerBoxZipcode").val().toUpperCase();;

			var isValidState = true;
            var isValidCity = true;
            var isValidZipcode = true;
			$('#answerBoxState').each(function () {
              if (!(answer["state"] in maps)) {
					isValidState = false;
					$("#answerBoxState").css({
						"border": "1px solid red",
						"background": "#FFCECE"
					});
			  } else if (!(answer["city"] in maps[answer["state"]])) {
					isValidCity = false;
					$("#answerBoxCity").css({
						"border": "1px solid red",
						"background": "#FFCECE"
					});
              } else if ((maps[answer["state"]][answer["city"]].indexOf(answer["zipcode"]) == -1) && (answer["zipcode"].length != 0)) {
					isValidZipcode = false;
					$("#answerBoxZipcode").css({
						"border": "1px solid red",
						"background": "#FFCECE"
					});

              } else {
					$("#answerBoxState").css({
						"border": "",
						"background": ""
					});
					$("#answerBoxCity").css({
						"border": "",
						"background": ""
					});
                    $("#answerBoxZipcode").css({
						"border": "",
						"background": ""
					});
              }

			});

			if (isValidState == false || isValidCity == false|| isValidZipcode == false) {
				evt.preventDefault();
			} else {
				pybossa.saveTask(task.id, answer).done(function() {
					$("#success").fadeIn();
					setTimeout(function() {
						$("#success").hide();
						deferred.resolve(task);
					}, 1500);
				});
			}
		});
		$("#idk").off('click').on('click', function(evt) {
			var answer = {}
			answer["city"] = "";
			answer["state"] = "";
			answer["zipcode"] = "";
			pybossa.saveTask(task.id, answer).done(function() {
				$("#success").fadeIn();
					setTimeout(function() {
						$("#success").hide();
						deferred.resolve(task);
					}, 1500);
			});
		});
	} else {
		$("#skeleton").hide();
		$("#finish").fadeIn(100);
	}
});
pybossa.run('FatHead');	
</script>
